import React from 'react';
import styled from 'styled-components/native';
import '../assets/Main.css'

const Position = styled.View`
    display: flex;
    flex-direction: column;
    position: fixed;
    top: 0px;
    width: 100%;
`;

const GrayBackground = styled.View`
    background: white;
    display: flex;
    justify-content: center;
    align-items:center;
    height: auto;
`;

const HeaderContents = styled.View`
    width: 1200px;
    height: 55px;
    display: flex;
    flex-direction: row;
    align-items: center;

    padding-right: 1rem;
    padding-left: 1rem;
`;

const Logo = styled.View`
    font-size: 1.4rem;
    letter-spacing: 2px;
`;

const Text = styled.View`
    font-family: 'title-font';
    font-size: 80px; 
    font-weight: bold;
    color:black;
`;

const Header = ({props}) => {
    return(
        <Position>
            <GrayBackground>
               <Text><a href="/main"> 술고래 </a></Text>
            </GrayBackground>
        </Position>
    );
}

export default Header;
